the_same(X,X).

reduce_list([H|T], X) :- the_same(H,X), length(T,0), !.
reduce_list(L, X) :- format('s~n'), member(X,L), feature(X,Feat,Val), \+not(X), yes(Feat,Val), findall(X,feature(X,Feat,Val),L2), reduce_list(L2,X), fail.

person_is(X) :- name_list(L), reduce_list(L, X), !.

eval_answer(X,Y,y) :- assertz(repl_yes(X,Y)), writeln('Y').
eval_answer(X,Y,n) :- assertz(repl_no(X,Y)), writeln('N'), feature(P,X,Y), assertz(not(P)), fail.

ask_yes(X,Y) :- format('is ~w a/an ~w of the person? (y/n)~n',[Y,X]),
read(Reply),
eval_answer(X,Y,Reply).

yes(X,Y) :- repl_yes(X,Y).
yes(X,Y) :- \+repl_yes(X,_), \+repl_no(X,Y), ask_yes(X,Y).


clean :- retractall(repl_yes(_,_)), retractall(repl_no(_,_)), retractall(not(_)).
run :- person_is(X), format('~nIs it ~w ?~n', X).
run :- write('I dont know').
